import React from "react";

const Hero = () => {
  return (
    <div className="hero">
      <div className="hero_sub container mt-3">
        <div className="hero_title">
          <h1>Parking Available for 200 Vehicle</h1>
        </div>
      </div>
    </div>
  );
};

export default Hero;
